    const data: countryProps[] = [
        {
            id: 1,
            name: "Aruba",
            currency: "FL"
        },
        {
            id: 2,
            name: "Brazil",
            currency: "BRL"
        },
        {
            id: 3,
            name: "England",
            currency: "POUND"
        },
        {
            id: 4,
            name: "Japan",
            currency: "YEN"
        }
    ];
    return (
        <Layout page="Components">
            <CountryContextProvider value={data[name]}>
                <CountryList/>
            </CountryContextProvider>
        </Layout>
    )
};

export default Components;
